import axios from "axios";

interface User {
	id:			number;
	email:		string;
	firstName?:	string;
	lastName?:	string;
	userName?:	string;
}

async function getUsers() {
	try {
	  const response = await axios.get('http://localhost:3001/user');
	//   console.log(response);
	  return response.data;
	} catch (error) {
	  console.error(error);
	  return [];
	}
  }

const App:React.FC = () =>
{
